const MY_KEY = 'a7a2bdfd-d685-4ee6-9da7-456a52f218f8';

export default async function userFetch() {
    const URL = `https://fortnite-api.com/v2/stats/br/v2/GaymerFialho`;
    const headers = {};

    try {
        const response = await fetch(URL, {
                "Authorization": MY_KEY,
                'method': 'GET',
                'mode': 'no-cors',
                'origin': '*',
                'headers': headers,
            })

        const data = await response.json();
        console.log(data)
        return data;

    } catch (error) {
        return Error(error)
    }


}
